import React from "react";
import {Redirect, Route} from "react-router-dom";

export const PrivateRoute = ({Component, ...rest}) => (
    <Route
        {...rest}
        render={props =>
            localStorage.getItem("feathers-jwt") !== null ? (
                <Component {...props} />
            ) : (
                <Redirect
                    to={{
                        pathname: "/login",
                        state: {from: props.location}
                    }}
                />
            )
        }
    />
);
